import {RenderTexture, Text} from "@react-three/drei";

export default function Box() {
    return (
        <mesh>
            <boxGeometry args={[1.8,1.8,1.8]}/>
            <meshStandardMaterial>
                <RenderTexture colorSpace={"red"} />
            </meshStandardMaterial>
        </mesh>
    )
}
